(* lit un sudoku sur l'entrée standard *)
let read_sudoku () =
  let a = 9 * 9 in
  let out_ = Array.init a (fun _i ->
    let k = Scanf.scanf "%d " (fun v_0 -> v_0) in
    k) in
  out_

(* affiche un sudoku *)
let print_sudoku sudoku_ =
  for y = 0 to 8 do
    for x = 0 to 8 do
      let b = sudoku_.(x + y * 9) in
      Printf.printf "%d" b;
      Printf.printf " ";
      if (x mod 3) = 2 then
        Printf.printf " "
    done;
    Printf.printf "\n";
    if (y mod 3) = 2 then
      Printf.printf "\n"
  done;
  Printf.printf "\n"

