(* dit si le sudoku est terminé de remplir *)
exception Found_1 of bool

let sudoku_done s =
  try
  for i = 0 to 80 do
    if s.(i) = 0 then
      raise (Found_1(false))
  done;
  raise (Found_1(true))
  with Found_1 (out) -> out

